exports('GetVehicles', function() return Vehicles end)
exports('GetVehiclesByCategory', function(category) return Vehicles[category] end)
exports('GetVehiclesByPartialName', function(partialName)
    local results = {}
    local searchTerm = partialName:lower()

    for _, category in pairs(Vehicles) do
        for _, vehicle in pairs(category) do
            if vehicle?.DisplayName:lower():find(searchTerm) or
               vehicle?.ModelName:lower():find(searchTerm) or
               vehicle?.RealName:lower():find(searchTerm) then
                table.insert(results, vehicle)
            end
        end
    end

    return results
end)
